import React, {Component} from 'react';
import {BrowserRouter} from 'react-router-dom';
import Menu from './common/menu';
import './App.css';

class App extends Component {
  render() {
    return (
          <BrowserRouter>
            <Menu/>
          </BrowserRouter>
    )
  }
}

export default App;
